import Vue from 'vue'
import Router from 'vue-router'

import login from '../components/login'
import index from '../components/index'
import test from '../components/test'
import mindex from '../components/member/index'

Vue.use(Router)

export default new Router({
	routes: [{
			path: '/login',
			component: login
		},
		{
			path: '/index',
			component: index,
			children: [{
				path: '/member/index',
				component: mindex
			}, {
				path: '/test',
				component: test
			}]
		},





	]
})
